import styles from "./styles/Hello.module.css";

export default function Hello()
{
    return (
        <div>
            <h1 style={
                {
                    color: "#f00",
                    borderRight: "2px solid #000",
                    marginBottom: "50px",
                    opacity: 1,
                }}>
                Hello
            </h1>
            <div className={styles.box}>Hello </div>
        </div>
    )
}
